import Head from 'next/head';

const Home = props => (
  <div>
    <Head>
      <title>NoStarz</title>
      <link rel="shortcut icon" type="image/x-icon" href="/assets/icon.png" />
    </Head>
    <p>Hey!</p>
  </div>
);

export default Home;
